import React from 'react';
import { Container, Row, Media, Image, Button} from 'react-bootstrap';

const Header = () => {

  return(
    <Container>
      <Media>
        <Image src="nvidia-logo.jpeg" style={{"height":"50px", "width":"50px"}} roundedCircle />
        <Media.Body>
          <h5>Nvidia</h5>
        </Media.Body>
      </Media>
    </Container>
  );
}

export default Header;
